
/* global describe, it, jsPDF, comparePdf, expect */
/**
 * Standard spec tests
 */

describe('Module: addimage filetypeRecognition', () => {

	it('webp dataUrl', () => {
		var webp = 'data:image/webp;base64,';
	    
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(webp))).toEqual("WEBP");
	});
	
	it('jpeg dataUrl', () => {
		let jpgImage = 'data:image/jpeg;base64,';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(jpgImage))).toEqual("JPEG");
	});

	it('jpeg base64', () => {
		let jpgImage = '';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(jpgImage))).toEqual("JPEG");
	}); 

	it('png dataUrl', () => {
		let pngImage = 'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAIAAACQd1PeAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAAAMSURBVBhXY/j//z8ABf4C/qc1gYQAAAAASUVORK5CYII=';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(pngImage))).toEqual("PNG");
	});

	it('png base64', () => {
		let pngImage = 'iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAIAAACQd1PeAAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAAAMSURBVBhXY/j//z8ABf4C/qc1gYQAAAAASUVORK5CYII=';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(pngImage))).toEqual("PNG");
	});

	it('gif89a dataUrl', () => {
		let gifImage = 'data:image/gif;base64,';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(gifImage))).toEqual("GIF89a");
	});

	it('gif89a base64', () => {
		let gifImage = '';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(gifImage))).toEqual("GIF89a");
	});

	it('bmp dataUrl', () => {
		let bmpImage = 'data:image/bmp;base64,Qk06AAAAAAAAADYAAAAoAAAAAQAAAAEAAAABABgAAAAAAAQAAADEDgAAxA4AAAAAAAAAAAAA////AA==';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(bmpImage))).toEqual("BMP");
	});

	it('bmp base64', () => {
		let bmpImage = 'Qk06AAAAAAAAADYAAAAoAAAAAQAAAAEAAAABABgAAAAAAAQAAADEDgAAxA4AAAAAAAAAAAAA////AA==';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(bmpImage))).toEqual("BMP");
	});

	it('tiff dataUrl', () => {
		let tiffImage = 'data:img/tiff;base64,';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(tiffImage))).toEqual("TIFF");
	});

	it('tiff base64', () => {
		let tiffImage = '';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(tiffImage))).toEqual("TIFF");
	});
	
	it('UNKNOWN base64', () => {
		let invalidImage = 'invalid';
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(invalidImage, 'UNKNOWN'))).toEqual("UNKNOWN");
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(invalidImage))).toEqual("UNKNOWN");
		var tmpConsoleWarn = console.warn;
		console.warn = function () {};
		expect(jsPDF.API.__addimage__.getImageFileTypeByImageData(jsPDF.API.__addimage__.convertBase64ToBinaryString(invalidImage), 'PNG')).toEqual("PNG");
		console.warn = tmpConsoleWarn;
	});
})
